import React from "react";

function Footer() {
  return (
    <div className="footer">
      <div className="footer-contents">
        <span>React Meme Generator &copy; 2022</span>
        <a
          href="https://github.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Github
        </a>
      </div>
    </div>
  );
}

export default Footer;
